import React, {useEffect, useState} from 'react';
import {ActivityIndicator, FlatList, Text, View} from 'react-native';
import firestore from '@react-native-firebase/firestore';
import {styles} from './styles';
import Card from '../../components/coachesComponents/card/card';
import {useFetchUsersQuery} from '../../services/apiSlice';

const Coaches = () => {
  const [data, setData] = useState({});

  useEffect(() => {
    const unsubscribe = firestore()
      .collection('Coaches')
      .doc('5nxRCfgQskrNViBn07GO') 
      .onSnapshot(
        snapshot => {
          if (snapshot.exists) {
            setData(snapshot.data());
          } else {
            console.log('No document Found');
          }
        },
        error => {
          console.error('Error', error);
        },
      );

    return () => unsubscribe();
  }, []);

  const {
    data: users,
    error: usersError,
    isLoading: usersLoading,
  } = useFetchUsersQuery();

  const usersList = users?.slice(0, 3);

  const customUserData = [
    {
      imageUrl:
        'data:image/jpeg;base64,',
      sessions: '20',
      languages: ['Hindi', 'French'],
      songType: ['Dating', 'marriage'],
      overallRating: '5.0',
      numberOfRatings: '2000',
      songPrice: '20',
      songDuration: '25',
    },
    {
      imageUrl:
        'data:image/jpeg;base64,',
      sessions: '21',
      languages: ['Telugu', 'French'],
      songType: ['Dating', 'BreakUp'],
      overallRating: '4.2',
      numberOfRatings: '2700',
      songPrice: '22',
      songDuration: '20',
    },
    {
      imageUrl:
        'data:image/jpeg;base64,',
      sessions: '21',
      languages: ['English', 'French'],
      songType: ['marriage', 'BreakUp'],
      overallRating: '4.8',
      numberOfRatings: '3200',
      songPrice: '28',
      songDuration: '28',
    },
  ];

  const userData = usersList?.map((obj, index) => ({
    ...obj,
    imageUrl: customUserData[index].imageUrl || customUserData[0].imageUrl, // Fallback URL
    sessions: customUserData[index].sessions,
    languages: customUserData[index].languages,
    songType: customUserData[index].songType,
    overallRating: customUserData[index].overallRating,
    numberOfRatings: customUserData[index].numberOfRatings,
    songPrice: customUserData[index].songPrice,
    songDuration: customUserData[index].songDuration,
  }));

  if (usersLoading) {
    return (
      <View style={styles.loaderContainer}>
        <ActivityIndicator size="large" color="#0000ff" />
        <Text>Loading...</Text>
      </View>
    );
  }

  if (usersError) {
    return (
      <View style={styles.errorContainer}>
        <Text>Error: {usersError?.message}</Text>
      </View>
    );
  }

  return (
    <View style={styles.container}>
      {userData && (
        <FlatList
          data={userData}
          renderItem={({item, index}) => (
            <Card item={item} data={data} index={index} />
          )}
          keyExtractor={item => item.id}
        />
      )}
    </View>
  );
};

export default Coaches;
